  state = {
    person:[
      {name:'Max',age:28},
      {name:'Manu',age:29},
      {name:'Stephanie',age:19}
    ]
  }





  render() {
    return (
      <div className="App">
        <h1>Hi, I'm a React App</h1>
        <Person name="max" age="28"/>  
        <Person name="manu" age="25">My hobbies :Racing </Person>  
        <Person name="stephanie" age="19"/>   
      </div>
    );
  }
}

export default App;
